import React from 'react'
import SignInNavbar from '../components/Navbar/SignInNavbar'
import './SignIn.css'
import signupImg from '../assets/signup.png'


function SignIn() {
  return (
    <>
      {/* Navbar */}
      <SignInNavbar/>
      {/* Page container  */}
      <div className='signin-container'>
          {/* flex */}
          <div className='signin-flex'>
            {/* image container */}
            <div>
              <img src={signupImg}/>
            </div>
            {/* right container */}
            <div className='right-containner'>
              {/* heading text */}
              <h1 class="input-title">เข้าสู่ระบบ</h1>
              {/* form container */}
              <div>
                <p class="input-label">อีเมล</p>
                <input type="email" name="email" class="textfield" />
                <p class="input-label">รหัสผ่าน</p>
                <input type="password" name="password" class="textfield" />
                {/* buttone div */}
                <div>
                  <button class="button-register">เข้าสู่ระบบ</button>
                </div>
              </div>
            </div>
        </div>

      </div>
    </>
  )
}

export default SignIn
